INSERT INTO `sdb_plugins` VALUES ('58', 'skypay', '\"我付了储值卡支付(OK卡等)\"', 'pay', '0', '20080901', null, null, null, null, null, 'false', 'a:3:{s:10:\"class_name\";s:10:\"pay_skypay\";s:5:\"props\";a:11:{s:4:\"name\";s:36:\"\"我付了储值卡支付(OK卡等)\"\";s:4:\"logo\";s:6:\"SKYPAY\";s:7:\"version\";s:8:\"20080901\";s:7:\"charset\";s:6:\"gb2312\";s:4:\"info\";s:630:\"我付了支付平台( http://www.wofule.com.cn )专注集中于为商户提供各种非银行卡资金源（联华OK卡、手机储值卡等）线上和线下的全方位支付服务，通过掌捷的非银行支付服务可以为商户提供多渠道的资金来源，同时带来更多潜在的用户群体。（中国市场上十亿多张的预付费的卡，并且每秒钟有1张预付费卡在增值。由于预付卡市场有超过90%的现存卡并不是自买自用型的,因此决定了大量的预付费卡持有者具有很强的消费欲望,并且希望能够找到更多的商户进行基于预付费卡的消费）\";s:5:\"intro\";s:784:\"\"我付了储值卡支付网关支持了如百联OK卡等在内的国内主流预付费卡（消费储值卡）的支付，商户添加我付了储值卡支付网关后，即可让用户持消费储值卡在商户处消费。<br>中国市场上十亿多张的预付费的卡，并且每秒钟有1张预付费卡在增值。由于预付卡市场有超过90%的现存卡并不是自买自用型的，因此决定了大量的预付费卡持有者具有很强的消费欲望。<br>集成我付了储值卡支付网关后，可以为商户吸引大量的预付费卡用户群及消费资金，极大提升商户的销售收入。<br><br>网关自助接入服务：<a href=\'http://www.wofule.com.cn/merchant_regist\' target=\'_blank\'>立即申请我付了</a><br>客服电话：400-820-7040 \"\";s:9:\"submitUrl\";s:49:\"http://gateway.wofule.com.cn/gateway/paymentorder\";s:12:\"submitButton\";s:54:\"http://img.alipay.com/pimg/button_alipaybutton_o_a.gif\";s:12:\"head_charset\";s:6:\"gb2312\";s:6:\"method\";s:4:\"post\";s:7:\"orderby\";s:2:\"12\";}s:5:\"funcs\";a:3:{s:8:\"tosubmit\";s:8:\"tosubmit\";s:8:\"callback\";s:8:\"callback\";s:9:\"getfields\";s:9:\"getfields\";}}', null, '/payment/pay.skypay.php', 'file', 'unused', 'false', '1348547605');
