INSERT INTO `sdb_plugins` VALUES ('61', 'hyl', '\"广州银联网付通\"', 'pay', '0', '20080619', null, null, null, null, null, 'false', 'a:3:{s:10:\"class_name\";s:7:\"pay_hyl\";s:5:\"props\";a:9:{s:4:\"name\";s:23:\"\"广州银联网付通\"\";s:4:\"logo\";s:5:\"\"HYL\"\";s:7:\"version\";s:8:\"20080619\";s:7:\"charset\";s:7:\"\"utf-8\"\";s:8:\"applyUrl\";s:2:\"\"\"\";s:5:\"intro\";s:698:\"\"广州银联网络支付有限公司于2000年2月2日建成开通网付通支付网关系统，开创了在网上为电子商务活动提供多种银行卡支付的先河。目前有十八家银行的二十多种类型的银行卡为银联在线及国内各大电子商务网站提供实时网上支付。<br><br>接口使用说明：<br>1:修改PHP的配置文件(php.ini)打开这几个模块<br>extension=php_curl.dll<br>extension=php_mcrypt.dll<br>extension=php_openssl.dll<br>2:修改插件文件plugins/payment/pay.hyl.php<br>DEFINE(\'OPEN_SSL_CONF_PATH\', \'d:wwwsoftphpopensslopenssl.cnf\');<br>将上句中的d:wwwsoftphpopensslopenssl.cnf修改为本机配置，路径视php版本而定。\"\";s:9:\"submitUrl\";s:71:\"\"http://test.gnete.com/Bin/Scripts/OpenVendor/Gnete/V34/GetOvOrder.asp\"\";s:12:\"submitButton\";s:54:\"http://img.alipay.com/pimg/button_alipaybutton_o_a.gif\";s:7:\"orderby\";s:2:\"17\";}s:5:\"funcs\";a:3:{s:8:\"tosubmit\";s:8:\"tosubmit\";s:8:\"callback\";s:8:\"callback\";s:9:\"getfields\";s:9:\"getfields\";}}', null, '/payment/pay.hyl.php', 'file', 'unused', 'false', '1348547604');
INSERT INTO `sdb_plugins` VALUES ('62', 'unspay', '\"银生支付\"', 'pay', '0', '1.0', null, null, null, null, null, 'false', 'a:3:{s:10:\"class_name\";s:10:\"pay_unspay\";s:5:\"props\";a:8:{s:4:\"name\";s:14:\"\"银生支付\"\";s:4:\"logo\";s:6:\"UNSPAY\";s:7:\"charset\";s:6:\"\"utf8\"\";s:8:\"applyUrl\";s:50:\"https://www.unspay.com/unspay/toCompanyRegister.do\";s:9:\"submitUrl\";s:57:\"https://www.unspay.com/unspay/page/linkbank/payRequest.do\";s:5:\"intro\";s:486:\"银生支付成立于2006年5月30日，是一家致力于在传统互联网和移动通讯网领域大规模应用在线支付,并以此为基础提供全方位金融配套服务的电子金融服务提供商。公司将不断扩大应用范围，实现多行业、多渠道、多元化的战略目标。以成为一流的电子商务金融服务的行业引导者为公司愿景，打造成为服务于全球用户的安全可靠、快速便捷的电子支付及金融应用平台。 \";s:7:\"orderby\";s:1:\"4\";s:12:\"head_charset\";s:7:\"\"utf-8\"\";}s:5:\"funcs\";a:4:{s:8:\"tosubmit\";s:8:\"tosubmit\";s:8:\"callback\";s:8:\"callback\";s:9:\"getfields\";s:9:\"getfields\";s:9:\"applyform\";s:9:\"applyform\";}}', null, '/payment/pay.unspay.php', 'file', 'unused', 'false', '1348547606');
