INSERT INTO `sdb_plugins` VALUES ('65', 'tenpay', '腾讯财付通[即时到账]', 'pay', '0', '20070902', null, null, null, null, '财付通是腾讯公司为促进中国电子商务的发展需要，满足互联网用户价值需求，针对网上交易安全而精心推出的一系列服务。', 'false', 'a:3:{s:10:\"class_name\";s:10:\"pay_tenpay\";s:5:\"props\";a:11:{s:4:\"name\";s:29:\"腾讯财付通[即时到账]\";s:4:\"logo\";s:6:\"TENPAY\";s:7:\"version\";s:8:\"20070902\";s:7:\"charset\";s:6:\"gb2312\";s:8:\"applyUrl\";s:50:\"http://union.tenpay.com/mch/mch_register_b2c.shtml\";s:9:\"submitUrl\";s:48:\"https://www.tenpay.com/cgi-bin/v1.0/pay_gate.cgi\";s:12:\"submitButton\";s:54:\"http://img.alipay.com/pimg/button_alipaybutton_o_a.gif\";s:4:\"desc\";s:165:\"财付通是腾讯公司为促进中国电子商务的发展需要，满足互联网用户价值需求，针对网上交易安全而精心推出的一系列服务。\";s:5:\"intro\";s:696:\"财付通是腾讯公司于2005年9月正式推出专业在线支付平台，致力于为互联网用户和企业提供安全、便捷、专业的在线支付服务。<br>财付通构建全新的综合支付平台，业务覆盖B2B、B2C和C2C各领域，提供卓越的网上支付及清算服务。<br>财付通先后荣膺2006年电子支付平台十佳奖、2006年最佳便捷支付奖、2006年中国电子支付最具增长潜力平台奖和2007年最具竞争力电子支付企业奖等奖项，并于2007年首创获得“国家电子商务专项基金”资金支持。<!--<br><br><font color=\"red\">本接口需点击以下链接(二选一)进行在线签约后方可使用。</font>-->\";s:7:\"orderby\";s:1:\"2\";s:12:\"head_charset\";s:6:\"gb2312\";}s:5:\"funcs\";a:4:{s:8:\"tosubmit\";s:8:\"tosubmit\";s:8:\"callback\";s:8:\"callback\";s:9:\"getfields\";s:9:\"getfields\";s:9:\"applyform\";s:9:\"applyform\";}}', null, '/payment/pay.tenpay.php', 'file', 'unused', 'false', '1348547606');
